import React,{useState} from 'react'
import './Travel.css'
import SubCategory from '../sharedComponents/SubCategory/SubCategory'

function Travel(props) {

    const [CategoryItemArray, setCategoryItemArray] = useState([
        {
            ItemName         : 'TaiWan' ,
            CoverImage       : '/Gallery/Travel/cover_taiwan.jpg' ,
            Link             :  '/travel/taiwan'  ,
        },
        {
            ItemName         : 'Singapore' ,
            CoverImage       : '/Gallery/Travel/cover_sg.jpg' ,
            Link             :  ''  ,
        },
        {
            ItemName         : 'Jeju Korea' ,
            CoverImage       : '/Gallery/Travel/cover_jeju.jpg' ,
            Link             :  ''  ,
        },
    ])



    return (
        <div className='travelRoot'>
            <SubCategory SubCategoryName = 'Travel' CategoryItemArray = {CategoryItemArray} />
        </div>
    )
}

export default Travel
